  [],\n\t\"revision_timestamp\": \"2015-05-06T22:03:29.553595\",\n\t\"name\": \"highly-stable-large-format-euv-imager-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Higher detection efficiency and better radiation
  tolerance imagers are needed for the next generation of EUV instruments. Previously,
  CCD technology has demonstrated EUV instability as well as degraded performance
  in radiation environments. Fortunately, CMOS imager technology has evolved to the
  stage that it is now feasible to fabricate multi-pixel arrays of diodes that can
  be absolutely calibrated and that are robust against radiation damage. CMOS sensors
  are less susceptible to radiation damage of the type that would disable entire regions
  of a CCD sensor. Nevertheless, the technology requires improved radiation tolerance.
  There currently does not exist a high performance, rad hard, EUV CMOS sensor. rnrnTo
  address these needs, Voxtel Inc. proposes to optimize the design of a radiation-hard,
  SOI CMOS back-illuminated EUV sensor with enhanced sensitivity and stable operation.
  The innovation?s reduced optical cross section (app. 500nm) increases the imager?s
  resolution, reduces radiation effects, and reduces the operating voltages required
  for silicon depletion. The ultra thin charge collection region is achieved through
  a novel, back-thinning method that offers superior manufacturability, stability,
  and reliability while maintaining compatibility with mainstream semiconductor fabrication
  processes. The low capacitance of SOI combined with our ultra-low noise amplifier
  design achieves previously unobtainable EUV imaging capabilities.\",\n\t\"license_title\":
